import React, { useState, useEffect } from 'react';
import EditUserModal from './EditUserModal'; // Make sure to adjust the path as needed
import EditShopModal from './EditShopModal'; // Make sure to adjust the path as needed
import './AdminDashboard.css'; // Add CSS for styles

const AdminDashboard = () => {
    const [users, setUsers] = useState([]);
    const [shops, setShops] = useState([]);
    const [selectedUser, setSelectedUser] = useState(null);
    const [selectedShop, setSelectedShop] = useState(null);
    const [showUserModal, setShowUserModal] = useState(false);
    const [showShopModal, setShowShopModal] = useState(false);

    // Fetch users and shops data from backend
    useEffect(() => {
        const fetchData = async () => {
            try {
                const [usersResponse, shopsResponse] = await Promise.all([
                    fetch('http://localhost:5000/admin/users', { credentials: 'include' }),
                    fetch('http://localhost:5000/admin/shops', { credentials: 'include' })
                ]);
                const usersData = await usersResponse.json();
                const shopsData = await shopsResponse.json();
                setUsers(usersData);
                setShops(shopsData);
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
    }, []);

    // Open User Modal
    const handleEditUser = (user) => {
        setSelectedUser(user);
        setShowUserModal(true);
    };

    // Open Shop Modal
    const handleEditShop = (shop) => {
        setSelectedShop(shop);
        setShowShopModal(true);
    };

    // Close Modals
    const handleCloseModal = () => {
        setShowUserModal(false);
        setShowShopModal(false);
        setSelectedUser(null);
        setSelectedShop(null);
    };

    return (
        <div className="admin-dashboard">
            <h1>Admin Dashboard</h1>
            
            {/* Users Section */}
            <div className="section">
                <h2>Users</h2>
                <table>
                    <thead>
                        <tr>
                            <th>Username</th>
                            <th>Email</th>
                            <th>Contact</th>
                            <th>Role</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {users.map((user) => (
                            <tr key={user._id}>
                                <td>{user.username}</td>
                                <td>{user.email}</td>
                                <td>{user.contact}</td>
                                <td>{user.role}</td>
                                <td>
                                    <button onClick={() => handleEditUser(user)}>Edit</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>

            {/* Shops Section */}
            <div className="section">
                <h2>Shops</h2>
                <table>
                    <thead>
                        <tr>
                            <th>Shop Name</th>
                            <th>Owner</th>
                            <th>Email</th>
                            <th>Contact</th>
                            <th>Status</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {shops.map((shop) => (
                            <tr key={shop._id}>
                                <td>{shop.shopname}</td>
                                <td>{shop.owner}</td>
                                <td>{shop.email}</td>
                                <td>{shop.contact}</td>
                                <td>{shop.status}</td>
                                <td>
                                    <button onClick={() => handleEditShop(shop)}>Edit</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>

            {/* Modals */}
            {showUserModal && (
                <EditUserModal
                    user={selectedUser}
                    onClose={handleCloseModal}
                />
            )}
            {showShopModal && (
                <EditShopModal
                    shop={selectedShop}
                    onClose={handleCloseModal}
                />
            )}
        </div>
    );
};

export default AdminDashboard;
